var lengthOfLongestSubstring = function (str) {
    'use strict';
    var length = 0 , strCharObj = {}, lengthArray = [], startIndex = 0, strArray =  str.trim().split('');
  
    if(str === null || typeof str == "undefined" || typeof str == "object"){
      console.error("Cannot process " + str);
      return length;
    } 
  
    if(typeof str != "string"){
      str = str.toString();
    }
  
    if(str.trim().length === 0){
      return length;
    }  
  
    
    strArray.forEach(function(elem,index,arry){
           if(strCharObj[elem] != "undefined" && strCharObj[elem] >= startIndex){             
               lengthArray.push(index - startIndex);
               startIndex = strCharObj[elem] + 1;
           }

          strCharObj[elem] = index;
    });
  
    lengthArray.push(strArray.length - startIndex);
    return Math.max.apply(null,lengthArray);
};


